import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


ReactDOM.render(
  <React.StrictMode>
      <h1>My Name is Kali</h1> 
      <p>I am from Hyd</p>
      <p>Hobbies</p>      
      <ul>
        <li>Cricket</li>
        <li>Games</li>
        <li>Coding</li>
      </ul>    
  </React.StrictMode>,
  document.getElementById('root')
);
